import React from "react";
import Header from "./Header";
import Card from "@mui/material/Card";
import Grid from "@mui/material/Grid";
import TextField from "@mui/material/TextField";
import Typography from "@mui/material/Typography";
import { Button } from "@mui/material";
const Login = () => {
  return (
    <>
      <Header />
      <Grid container justifyContent="center">
        <Grid item xs={12} sm={10} md={8}>
          <form method="POST">
            <Card
              sx={{
                background: "#f3f6fd",
                color: "black",
                borderRadius: 4,
                display: "flex",
                flexDirection: "column",
                alignItems: "center",
                justifyContent: "center",
                padding: 2,
                width: "100%",
                marginTop: "100px",
                marginBottom: "15px",
              }}
            >
              <Typography
                variant="h6"
                component="h6"
                sx={{
                  color: "#818090",
                  textAlign: "center",
                  position: "relative",
                }}
              >
                Login your account
              </Typography>
              <Typography
                variant="h4"
                component="h4"
                sx={{
                  color: "black",
                  textAlign: "center",
                  position: "relative",
                  margin: "10px",
                }}
              >
                Logged in to stay in touch
              </Typography>
              <Grid container justifyContent="center">
                <Grid
                  item
                  xs={12}
                  sm={12}
                  sx={{ display: "flex", justifyContent: "center" }}
                >
                  <TextField
                    required
                    label="Enter user name"
                    variant="outlined"
                    color="secondary"
                    name="fname"
                    sx={{
                      width: "70%", 
                      mt: { xs: 3, sm: 2, md: 2 },
                      mb: { sm: 2, md: 2 },
                    }}
                  />
                </Grid>
                <Grid
                  item
                  xs={12}
                  sm={12}
                  sx={{ display: "flex", justifyContent: "center" }}
                >
                  <TextField
                    required
                    label="Enter password"
                    variant="outlined"
                    color="secondary"
                    name="fname"
                    sx={{
                      width: "70%", 
                      mt: { xs: 3, sm: 2, md: 1 },
                      mb: { sm: 2, md: 2 },
                    }}
                  />
                </Grid>
                <Grid item ={6}
                  sx={{ display: "flex", justifyContent: "center" }}
                >
                   <Button
                    variant="contained"
                    size="large"
                    color="secondary"
                    sx={{
                      padding: "15px",
                      mt: 3,
                      mb: 3,
                      ":hover": {
                        backgroundColor: "#212529",
                      },
                    }}
                  >
                    Log in
                  </Button>
                </Grid>
              </Grid>
            </Card>
          </form>
        </Grid>
      </Grid>
    </>
  );
};

export default Login;
